import React from 'react';

function PopupWithForm(props) {
    return(
        <article className={`popup ${props.name}-popup`}>
        <div className="popup__container">
          <button type="button" className="popup__close-icon" />

          <h2 className="popup__title">{props.title}</h2>

          <form
            className="popup__form popup__form_type_edit"
            name={props.form}
            noValidate
          >
              
            <fieldset className="popup__form-set">
              {props.children}
              <button
                type="submit"
                className="popup__button profile-edit-popup__button popup__button_type_inactive"
                disabled
              >
                {props.buttonLabel}
              </button>
            </fieldset>
          </form>
        </div>
      </article>
    );
}

export default PopupWithForm;
